import React from 'react';
import Size from '../components/Size';
const SizeContainer=()=>(
    <div style={{width:'200px',display:'flex',flexWrap:'wrap'}}>
        <Size size={'XS'}/>
        <Size size={'S'}/>
        <Size size={'M'}/>
        <Size size={'ML'}/>
        <Size size={'L'}/>
        <Size size={'XL'}/>
        <Size size={'XXL'}/>
     

    </div>
)

export default SizeContainer;
